import React from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState([])

  React.useEffect(() => {
    fetch("/questions")
      .then((res) => res.json())
      .then((data) => setData(data))});

      return (
        <div>
          {data.map((item) => (
            <div key={item.id}>
              <h2>{item.question}</h2>
              <p>{item.correct}</p>
              <p>{item.alphaincorrect}</p>
              <p>{item.bravoincorrect}</p>
              <p>{item.charlieincorrect}</p>
            </div>
          ))}
        </div>
      );
    };


export default App;
